import React from "react";

const Admin = () => {
    return(
        <table>
            <thead>
                <tr>
                    <th>Course Name</th>
                    <th>Criteria 1</th>
                    <th>Criteria 2</th>
                    <th>Criteria 3</th>
                    <th>Criteria 4</th>
                </tr>
            </thead>
        </table>
    )
}

export default Admin;
